import React from "react";

function SkillsSection() {
  return (
    <section className="py-20 bg-gray-50 text-center">
      <h2 className="text-3xl font-bold text-gray-900 mb-4">My Skills</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-6 px-8 max-w-6xl mx-auto">
        {[
          {
            title: "UI/UX Design",
            desc: "Figma, Adobe XD, Sketch",
            color: "from-purple-200 to-pink-200",
          },
          {
            title: "Frontend Dev",
            desc: "React, Vue, Tailwind",
            color: "from-blue-200 to-blue-100",
          },
          {
            title: "Branding",
            desc: "Logo, Identity, Print",
            color: "from-yellow-200 to-yellow-100",
          },
          {
            title: "Motion Graphic",
            desc: "After Effects, Lottie",
            color: "from-purple-100 to-blue-100",
          },
        ].map((item, i) => (
          <div
            key={i}
            className={`bg-gradient-to-br ${item.color} p-6 rounded-2xl shadow hover:shadow-lg transition`}
          >
            <h3 className="font-semibold text-gray-800 text-lg mb-2">
              {item.title}
            </h3>
            <p className="text-gray-600 text-sm">{item.desc}</p>
          </div>
        ))}
      </div>
    </section>
  );
}
export default SkillsSection;
